mapper.select:
SELECT

FROM TBL_GANTRY_TRAVELIMAGE_${year} tgt2 WHERE 1 = 1

    AND tgt2.GANTRY_ID LIKE '%' || #{gantryId} || '%'


    AND tgt2.GANTRY_ORDER_NUM = #{gantryOrderNum}


    AND tgt2.GANTRY_HEX LIKE '%' || #{gantryHex} || '%'


    AND tgt2.PIC_TIME = #{picTime}


    AND tgt2.DRIVE_DIR = #{driveDir}


    AND tgt2.CAMERA_NUM = #{cameraNum}


    AND tgt2.HOUR_BATCH_NO LIKE '%' || #{hourBatchNo} || '%'


    AND tgt2.SHOOT_POSITION = #{shootPosition}


    AND tgt2.LANE_NUM LIKE '%' || #{laneNum} || '%'


    AND tgt2.VEHICLE_PLATE LIKE '%' || #{vehiclePlate} || '%'


    AND tgt2.VEHICLE_SPEED = #{vehicleSpeed}


    AND tgt2.IDENTIFY_TYPE = #{identifyType}


    AND tgt2.VEHICLE_MODEL LIKE '%' || #{vehicleModel} || '%'


    AND tgt2.VEHICLE_COLOR LIKE '%' || #{vehicleColor} || '%'


    AND tgt2.IMAGE_SIZE = #{imageSize}


    AND tgt2.LICENSE_IMAGE_SIZE = #{licenseImageSize}


    AND tgt2.BIN_IMAGE_SIZE = #{binImageSize}


    AND tgt2.RELIABILITY LIKE '%' || #{reliability} || '%'


    AND tgt2.VEH_FEATURE_CODE LIKE '%' || #{vehFeatureCode} || '%'


    AND tgt2.FACE_FEATURE_CODE LIKE '%' || #{faceFeatureCode} || '%'


    AND tgt2.VERIFY_CODE LIKE '%' || #{verifyCode} || '%'


    AND tgt2.TRADE_ID LIKE '%' || #{tradeId} || '%'


    AND tgt2.MATCH_STATUS = #{matchStatus}


    AND tgt2.VALID_STATUS = #{validStatus}


    AND tgt2.DEAL_STATUS = #{dealStatus}


    AND tgt2.RELATED_PIC_ID LIKE '%' || #{relatedPicId} || '%'


    AND tgt2.ALL_RELATED_PIC_ID LIKE '%' || #{allRelatedPicId} || '%'


    AND tgt2.STATION_DBTIME = #{stationDbtime}


    AND tgt2.STATION_DEAL_TIME = #{stationDealTime}


    AND tgt2.STATION_VALID_TIME = #{stationValidTime}


    AND tgt2.STATION_MATCH_TIME = #{stationMatchTime}


    AND tgt2.COGNATE_SERIAL LIKE '%' || #{cognateSerial} || '%'


    AND tgt2.ALL_COGNATE_SERIAL LIKE '%' || #{allCognateSerial} || '%'


    AND tgt2.CHARGE_UNIT_ID LIKE '%' || #{chargeUnitId} || '%'


    AND tgt2.TRANS_DATE LIKE '%' || #{transDate} || '%'


    AND tgt2.VERSION_INFO LIKE '%' || #{versionInfo} || '%'


    AND tgt2.SPARE1 LIKE '%' || #{spare1} || '%'


    AND tgt2.SPARE2 LIKE '%' || #{spare2} || '%'


    AND tgt2.SPARE3 LIKE '%' || #{spare3} || '%'


    AND tgt2.SPARE4 LIKE '%' || #{spare4} || '%'


    AND tgt2.SPARE5 = #{spare5}


    AND tgt2.SPARE6 = #{spare6}


    AND tgt2.SPARE7 = #{spare7}


    AND tgt2.SPARE8 LIKE '%' || #{spare8} || '%'


    AND tgt2.TYPE = #{type}


    AND tgt2.RSU_MATCH_RESULT = #{rsuMatchResult}


    AND tgt2.RSU_MATCH_TRANS_ID LIKE '%' || #{rsuMatchTransId} || '%'


    AND tgt2.RSU_MATCH_RELIABILITY = #{rsuMatchReliability}

SELECT

FROM TBL_GANTRY_TRAVELIMAGE_${year} tgt2 WHERE tgt2.PIC_ID IN

    #{picId}
